const Shops = (onShop, shops) => {
  return (
    <div>
      <p onClick={() => setFilter('')}>All shops</p>
      {shops?.map(item => {
        return (
          <p key={item.index} onClick={() => setFilter(item)}>
            {' '}
            {item}
          </p>
        );
      })}
    </div>
  );
};

export default Shops;
